import React from 'react';
import './DisplayImage.css';


const DisplayImage = ({ imageUrl ,top, right, bottom, left} ) =>{ 
    return(
       
        <div className='centerd ma'>
            <div>
                <img src={imageUrl}  alt='photosss' width='500px' height='auto' id="inputImage"/>
                <div className='bounding-box' style={{ top: top, right: right, bottom: bottom, left: left }}></div>
            </div>
        </div>  
    

    );
            
}

export default DisplayImage;
